}; In this example, we've defined a Person structure with three members: name (a character array), age (an integer), and height (a floating-point number). To use a structure, you need to create a variable of the structure type. This is done by using the struct keyword followed by the structure name, and then the variable name: struct Person person1; Now, you can access the members of the structure using the dot (.) operator: person1.name = "John Doe";
